import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Home from './component/Home';
import Typography from '@material-ui/core/Typography'
import Button from '@material-ui/core/Button';
import Orders from './component/orders';
import Search from  './component/search';
class App extends Component {
  constructor(props) {
    super(props)
    this.state = { users: [] }
  }
  render() {
    return (
      <div>
        <Router>
          <div> 
          <Typography variant='display1' align='center' gutterBottom>
        Search the github user's
      </Typography>
     <Button variant="contained" color="primary" size ="small" ma  class = "homebutton"  >Home</Button>
     <Button variant="contained" color="primary" size ="small">History</Button>
             <Search ></Search>
            <Route exact path="/" component={Home} />
            <Route exact path = "/Searcheduser" component = {Home}/>
          </div>
        </Router>
      </div>
    );
  }
}

export default App;
